import MotionHoc from "./MotionHoc";
import styled from "styled-components";

const Section = styled.div`
    width: 100%;
    padding: 20%;
    text-align: center;
    color: white;
`;

const ProjectsComponent = () => {
  return <Section>
            <h1>Albums</h1>
        </Section>;
};

const Projects = MotionHoc(ProjectsComponent);

export default Projects;
